import React, {useState, useEffect} from 'react';

export default function Dev() {

    const running_mov = require('../../resources/running-2.m4v');
    const running_webm = require('../../resources/running-1.webm');

    return (
        <div className='background-image-container' id='container-runs'>
            <div className="container-ground">
                <div>
                    <div>
                    <video width="600" height="100%" loop={true} muted={true} autoplay={true} playsinline={true}>
                        <source 
                            src={ running_mov } 
                            type='video/mp4; codecs="hvc1"'/>
                        <source 
                            src={ running_webm } 
                            type="video/webm" />
                    </video>
                    </div>
                    <div>
                        <h1>Hold on whilst we analyse your runs</h1>
                        <p>This shouldn't take long, we're pacing ourselves.</p>
                    </div>
                </div>
            </div>
        </div>
    )
}
